import { Component } from 'react';
import { Container } from 'react-bootstrap';
import Footer from '../Footer'

class Home extends Component {
    constructor(props) {
        super(props);
        this.state = { name: 'Rodrigo' };
      }
    render() {
        return (
            <Container fluid className="homebg p-0">
                <Container className="homeCont"> 
                {/*<SideNav/>*/}
                    <div className="homeCont_wrapper">
                        <h1>Hey there,<br /> I'm Rodrigo. <span>I create engaging and<br /> pixel perfect websites.</span></h1> 
                        <h3>Front End Developer / Web Developer / Self-Taught Dev</h3>
                    </div>
                </Container>
                <Footer/>
            </Container>
            
        )
    }
}
export default Home;
